import React from 'react'
import { makeStyles,withStyles } from "@material-ui/core";

const useStyles = makeStyles({
    appmain:{
        
        flexDirection: 'column',
        position: 'absolute',
        top : '75px',
        left : '235px',
        width : '82%',
        height : '100%',
        backgroundColor : '#fff'

    }
})



function Date1() {
    var date = Date.now.toString;
    console.log(date);
    return (
        <>
        <span style={{float:'Right', color:'grey', fontSize:'10px'}}>Last Updated:</span>
        <div>{{date}}</div>
        </>
    )
}


export default function AppMain() {
    const classes = useStyles()
    return (
        <div className={classes.appmain}>
            <br />
            <span style={{marginTop:'100px', paddingLeft:'25px', paddingTop:'100px', width:'200px'}}>Patient Information</span>
            <Date1 />
            
        </div>
    )
}
